// ----------------------
// AUTOSPLIT
// ----------------------
function autosplit(raw) {
    let clean = raw.trim().replace(/\s+/g, " ");
    let parts = clean.split(/(?<=[.?!]) +/);

    let corpus = [];
    for (let p of parts) {
        let line = p.trim();
        if (line.length < 5) continue;
        if (!/[.?!â€¦]$/.test(line)) line += ".";
        corpus.push(line);
    }
    return corpus;
}

let CORPUS = autosplit(RAW_CORPUS);
