// ----------------------
// NORMALIZACJA
// ----------------------
function normalize(t) {
    t = t.toLowerCase();
    const repl = { "Ä…":"a","Ä‡":"c","Ä™":"e","Å‚":"l","Å„":"n","Ã³":"o","Å›":"s","Å¼":"z","Åº":"z" };
    for (let a in repl) t = t.replaceAll(a, repl[a]);
    t = t.replace(/[^a-z0-9 ]/g, " ");
    return t.trim();
}

// ----------------------
// WYSZUKIWANIE
// ----------------------
function best_line_for(words) {
    let scored = [];

    for (let line of CORPUS) {
        let nline = normalize(line);
        let hits = 0;

        for (let w of words) {
            let pattern = new RegExp("\\b" + w + "\\b");
            if (pattern.test(nline)) hits++;
        }

        if (hits > 0) scored.push([hits, line]);
    }

    if (scored.length === 0) return null;

    let maxHits = Math.max(...scored.map(s => s[0]));
    let best = scored.filter(s => s[0] === maxHits).map(s => s[1]);

    return best[Math.floor(Math.random() * best.length)];
}

// ----------------------
// PRZYCIÄ˜CIE DO PIERWSZEJ KROPKI
// ----------------------
function trim_to_first_sentence(text) {
    let parts = text.split(".");
    parts = parts.map(p => p.trim()).filter(p => p.length > 0);
    return parts[0] + ".";
}

// ----------------------
// SILNIK ODPOWIEDZI
// ----------------------
function answer(msg) {
    let n = normalize(msg);
    if (!n) return "Napisz coÅ› wiÄ™cej ğŸ™‚";

    let words = n.split(" ");
    let line = best_line_for(words);

    if (!line) return "Nie znalazÅ‚em Å¼adnego pasujÄ…cego sÅ‚owa w korpusie.";

    return trim_to_first_sentence(line);
}

